import {Container,Nav,Navbar,Row,Col,Form} from 'react-bootstrap';
import './App.css';
import { useState } from 'react';
import data from './data.js';
import { Routes,Route,Link,Outlet, useNavigate } from 'react-router-dom';
import Detail from './routes/detail.js'
import About from './routes/about.js'
import { FaUser,FaHeart,FaShoppingBag } from "react-icons/fa";

function App() {

  let [modal,setModal]=useState(false);
  let [shoes]=useState(data);
  let navigate=useNavigate();
  return (   

    <div className="App">

<Navbar className="Header" fixed="top" bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="/">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="detail">Detail</Nav.Link>
            <Nav.Link href="about">About</Nav.Link>
            <Nav.Link onClick={()=>{navigate(-1)}}>뒤로가기</Nav.Link>
          </Nav>
        </Container>
        <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
        </Form>
        <button><FaUser/></button>
        <button><FaHeart/></button>
        <button><FaShoppingBag/></button>
      </Navbar>
      <Routes>
        <Route path="*" element={<div>404없는페이지</div>}/>
        <Route path ="/" element={<body className="Body">
        <h4>OUTWEAR</h4> 
        <hr></hr>
        <button onClick={()=>setModal(!modal)} aria-expanded="false" aria-controls="refinement-wrap">Filters &amp; sort by<i></i></button>
        {modal==true?<Modal></Modal>:null}
        <hr></hr>
        <button className="Tag">태그 X</button>
        <Container>
          <Row>
            <Col><Card shoes={shoes[0]} i={1}/></Col>
            <Col><Card shoes={shoes[1]} i={2}/></Col>
            <Col><Card shoes={shoes[2]} i={3}/></Col>
          </Row>
          <Row>
            <Col>4</Col>
            <Col>5</Col>
            <Col>6</Col>
          </Row>
        </Container>
      </body>}/>
        <Route path="/detail/:id" element={<Detail shoes={shoes}/>}>
        </Route>
        <Route path="/about" element={<About/>}>
          <Route  path="member" element={<Member/>}/> 
          <Route path="location" element={<Location/>}></Route>
        </Route>
      </Routes>      
    </div>
  );
}

function Modal(){
  return(
    <div className="Modal">
      <p>스타일 선택</p>
      <p>색상 선택</p>
      <p>sort</p>
    </div>
  )
}

function Card(props){
  let navigate=useNavigate()
  return(
  <div className="Item" onClick={()=>{navigate('/detail'+ '/'+ String(parseInt(props.i)-1))}}>
    <img src={'https://codingapple1.github.io/shop/shoes' + props.i +'.jpg'} width="80%"/>
    <h4>{props.shoes.title}</h4>
    <p>{props.shoes.price}</p>
  </div>
  )
}

function Member(){
  return(
    <div>member페이지임</div>
  )
}
function Location(){
  return(
    <div>location페이지임</div>
  )
}
export default App;
